#include <iostream>
#include <vector>

using namespace std;

class Solution {
public:
    int maxProduct(vector<int>& nums) {
      vector<int> sub_products;
      int n = nums.size();
      int max_product = nums[0];
      for (auto i = 0; i < n; ++i) {
	sub_products.push_back(nums[i]);
	if (sub_products[i] > max_product)
	  max_product = sub_products[i];
      }

      for (auto i = 0; i < n; ++i) {
	if (sub_products[i] == 0)
	  continue;
	for (auto offset = 1; offset < n; ++offset) {
	  if (i >= n - offset)
	    break;
	  sub_products[i] *= nums[i + offset];
	  if (sub_products[i] > max_product)
	    max_product = sub_products[i];
	}
      }

      return max_product;
    }
};

